package Avião;

public class Aviaozin {

	private String aviao;
	private String nomedopiloto;
	private String nomedacompanhia;
	private String destino;
	
	
	
	
	
	
	
	
	public Aviaozin() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	
	
	
	public String getAviao() {
		return aviao;
	}




	public void setAviao(String aviao) {
		this.aviao = aviao;
	}




	public String getNomedopiloto() {
		return nomedopiloto;
	}




	public void setNomedopiloto(String nomedopiloto) {
		this.nomedopiloto = nomedopiloto;
	}




	String getNomedacompanhia() {
		return nomedacompanhia;
	}
	public void setNomedacompanhia(String nomedacompanhia) {
		this.nomedacompanhia = nomedacompanhia;
	}
	public String getDestino() {
		return destino;
	}
	public void setDestino(String destino) {
		this.destino = destino;
	}
	
	
}
